import React from "react";
import Link from "next/link";

import { Menu } from "antd";
import {
  MailOutlined,
  AppstoreOutlined,
  SettingOutlined
} from "@ant-design/icons";

const { SubMenu } = Menu;

const Nav = ({ categories }) => {
  state = {
    current: "mail"
  };

  handleClick = (e) => {
    console.log("click ", e);
    this.setState({ current: e.key });
  };

  return (
    <nav>
      <ul>
        <li>
          <Link href="/">
            <a>Devtones</a>
          </Link>
        </li>
        <li>
          <Link href="/about">
            <a>About</a>
          </Link>
        </li>
      </ul>

      <ul>
        {categories.map((category) => {
          return (
            <li key={category.id}>
              <Link as={`/category/${category.id}`} href="/category/[id]">
                <a>{category.name}</a>
              </Link>
            </li>
          );
        })}
      </ul>
    </nav>
  );
};

export default Nav;
